import React from "react";
import { Container, Form } from "./styles";
import Input from "../../Components/input/Input";
//import ReactDOM from 'react-dom';

const Login = () => {
  return (
    <Container>
      <Form>
        <h1>Faça o seu login</h1>
        <div>
          <p>Não possui conta</p>
          <p>Cadastrar</p>
        </div>
      </Form>
    </Container>
  );
};

export default Login;
